import React from 'react';
import { Link, Outlet } from 'react-router-dom';
import '../styles/homepage.css';

const HomePage = ({ user }) => {
  return (
    <div className="homepage">
      {/* Top Bar */}
      <header className="topbar">
        <div className="topbar-left">
          <img src="https://via.placeholder.com/40" alt="Logo" className="logo" />
          <span className="company-name">InvoiceQuick</span>
        </div>
        <div className="topbar-right">
          <div className="dummy-icons">
            <span className="icon">üîî</span>
            <span className="icon">‚öôÔ∏è</span>
          </div>
          <div className="user-info">
            {user ? (
              <>
                <span className="user-icon">üë§</span>
                <span className="user-name">{user.name}</span>
              </>
            ) : (
              <span>Please Log In</span>
            )}
          </div>
        </div>
      </header>

      {/* Sidebar */}
      <aside className="sidebar">
        <nav>
          <ul>
            <li>
              <Link to="/homepage/dashboard">
                <span className="icon">üìä</span>
                Dashboard
              </Link>
            </li>
            <li>
              <Link to="/homepage/invoices">
                <span className="icon">üìÑ</span>
                Invoices
              </Link>
            </li>
            {/* Add more links as needed */}
          </ul>
        </nav>
      </aside>

      {/* Main Content */}
      <main className="main-content">
        <Outlet /> {/* This will render the selected page content */}
      </main>
    </div>
  );
};

export default HomePage;
